import React, { useEffect, useState } from 'react';
import { getEmployees } from '../api';

const EmployeeList = ({ token }) => {
    const [employees, setEmployees] = useState([]);

    useEffect(() => {
        const fetchEmployees = async () => {
            const data = await getEmployees(token);
            setEmployees(data);
        };
        fetchEmployees();
    }, [token]);

    return (
        <div>
            <h2>Lista de Empleados</h2>
            {employees.length > 0 ? (
                <ul>
                    {employees.map((employee) => (
                        <li key={employee.employee_id}>
                            <strong>{employee.first_name} {employee.last_name}</strong><br />
                            <strong>Correo:</strong> {employee.email} <br />
                            <strong>Cargo:</strong> {employee.job_id} <br />
                            <strong>Salario:</strong> ${employee.salary} <br />
                            <strong>Teléfono:</strong> {employee.phone_number} <br />
                            <strong>Fecha de Contratación:</strong> {employee.hire_date} <br />
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No se encontraron empleados.</p>
            )}
        </div>
    );
};

export default EmployeeList;
